    body {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
      background-color: #fff;
      font-family: 'Poppins', sans-serif;
      font-size: 21px;
      font-weight: 400;
      line-height: 1.3;
      color: #898989;
    }

    h1,
    h2,
    h3,
    h4,
    h5,
    h6 {
      margin: 0;
      color: #000;
    }

    strong {
      font-weight: 700;
    }

    .img-fluid {
      display: block;
      max-width: 100%;
      height: auto;
    }

    .img-fluid.center {
      margin: 0 auto;
    }

    .text-center {
      text-align: center;
    }

    .text-right {
      text-align: right;
    }

    .container {
      max-width: 1200px;
      margin: 0 auto;
    }

    .row-new {
      display: flex;
    }

    .align-items-center {
      align-items: center;
    }

    .justify-content-between {
      justify-content: space-between;
    }

    .col {
      flex: 1;
    }

    .col.auto {
      flex: unset;
    }

    .section {
      margin: 0 110px 110px;
    }

    .section-title {
      margin-bottom: 30px;
      font-size: 36px;
      font-weight: 700;
    }

    .hero {
      position: relative;
      margin-bottom: 50px;
    }

    .hero-title {
      position: absolute;
      top: 15%;
      left: 0;
      max-width: 510px;
      padding: 0 6%;
      font-size: 46px;
      font-weight: 700;
      color: #fff;
    }

    .hero-ticket {
      position: absolute;
      bottom: 6%;
      right: 8%;
    }

    .motto {
      margin: 0 110px 110px;
      text-align: center;
    }

    .motto-title {
      font-size: 42px;
      font-weight: 700;
    }

    .motto-subtitle {
      font-size: 42px;
      font-weight: 500;
    }

    .why {
      margin-bottom: 120px;
    }

    .why .section-title {
      margin-bottom: 0;
    }

    .why-text {
      position: relative;
      max-width: 200px;
      margin: 30px auto 0;
      padding-top: 20px;
      font-size: 21px;
      font-weight: 400;
      text-align: center;
    }

    .why-text::before {
      content: '';
      position: absolute;
      top: 0;
      left: 5%;
      right: 5%;
      height: 1px;
      background-color: #464646;
    }

    .why-text::after {
      content: '';
      position: absolute;
      top: 1px;
      left: 50%;
      transform: translateX(-50%);
      display: inline-block;
      width: 0;
      height: 0;
      border-style: solid;
      border-width: 5px 5px 0 5px;
      border-color: #464646 transparent transparent transparent;
    }

    .video {
      aspect-ratio: 16 / 9;
      margin-bottom: 30px;
    }

    .w-40 {
      width: 40%;
    }

    .w-50 {
      width: 50%;
    }

    .w-55 {
      width: 55%;
    }

    .feature1 {
      margin-top: -50px;
    }

    ul {
      margin: 0;
      padding: 0;
      list-style: none;
    }

    @media (max-width: 1000px) {
      .why .row {
        flex-wrap: wrap;
      }

      .why .row .col {
        flex: auto;
        width: 50%;
        margin-bottom: 40px;
      }

      .why .row .col img {
        margin: 0 auto;
      }

      .feature1 {
        flex-wrap: wrap;
      }

      .feature1 .col {
        width: 100%;
        margin-bottom: 30px;
      }

      .feature1 .col img {
        margin: 0 auto;
      }
    }

    @media (max-width: 756px) {
      body {
        font-size: 17px;
      }

      .motto-title,
      .motto-subtitle {
        font-size: 34px;
      }

      .why .row .col {
        width: 100%;
      }

      .section {
        margin: 0 20px 50px;
      }

      .section-title {
        font-size: 28px;
        margin-bottom: 20px;
      }

      .hero-title {
        top: 20px;
        padding: 0 20px;
        font-size: 36px;
      }

      .row-new {
        flex-wrap: wrap;
      }

      .col {
        flex: auto;
        width: 100%;
        margin-bottom: 30px;
      }

      img {
        margin: 0 auto;
      }

      .text-right {
        text-align: left;
      }

      [class*="w-"] {
        width: 100%;
      }
    }
  


Zelia3 2 in 1 Portbebeli Bebek Arabası 

 

Neden Seçmeliyim?

 
Çift Yönlü Kullanım İmkanı 
 
Hafif Tasarım Seyahat Seti (11 kg) 
 
Portbebeye Dönüşebilir 
 
Geniş Alışveriş Sepeti 



Doğumdan İtibaren4 Yaşına Kadar Kullanım (22kg) 
Bebeğinizin doğduğu ilk günden itibaren dört yaşına kadar istediğiniz her yere götürebileceğiniz bir bebek arabanız olsaydı? Hayal etmenize gerek yok. İhtiyaç duyduğunuz her şeyi bir arada sunan bebek arabası Maxi Cosi Zelia3’e merhaba deyin.
 

2'si 1 Arada Bebek Arabası
Zelia3 2 in 1 Portbebeli Bebek Arabası, doğumdan itibaren hem sürüş hem de sürüş yönünün tersine dönük kullanılabilen ve yatırılabilen oturma ünitesi, ekstra yumuşak dolgulu yeni doğan bebeklere uygun koltuk ünitesi ile sadece saniyeler için bir portbebeye dönüşür. Bebeğiniz kendi başına oturabilecek kadar büyüdüğünde, portbebe geniş ve rahat bir bebek arabası koltuğuna dönüşür. Bu, 2'si 1 arada bebek arabasını doğumdan 4 yaşına kadar uygun hale getirir. 

 


 

Geniş Alışveriş Sepeti
Zelia3 2 in 1 Portbebeli Bebek Arabasının yalnızca 11 kg'lık hafif tasarımı, kalabalık sokaklarda manevra yapmasını kolaylaştırır ve geniş alışveriş sepeti, alışverişlerde size kolaylık sağlar. Sepet, cüzdanınız ve telefonunuz gibi eşyalarınızı güvenli bir şekilde saklamak için gizli bir cebe de sahiptir.



Zelia3 2 in 1 Portbebeli Bebek Arabası, herhangi bir Maxi Cosi bebek oto koltuğu eklemenize izin veren esnek bir seyahat sistemine sahiptir. Bebek oto koltuğunu sadece iki hamlede takın ve gitmeye hazırsınız.
 

Genel Özellikler

- Doğumdan itibaren yaklaşık 4 yaşına kadar (22 kg) kullanım kolaylığı
- Maxi Cosi oto güvenlik koltukları ile uyumlu 
- Bebeğiniz için doğumdan itibaren ideal yatırma pozisyonu
- Doğumdan itibaren çift yönlü olarak kullanılabilen ve yatırılabilen oturma ünitesi
- Ekstra yumuşak dolgulu yeni doğan bebeklere uygun koltuk ünitesi
- Oturma ünitesi sadece saniyeler için bir portbebeye dönüşür

Genel Özellikler

- 5 noktalı emniyet kemeri
- Döndürülebilir ön bar
- Tek elle yatış pozisyonu ayarlayabilme
- Tek elle katlama
- Katlandığında ayakta durabilme
- Ön tekerlek kilidi
- Yükseklik Ayarlı itme barı
- Geniş XXL sepet (>10kg)
- Ebeveyn cebi
- Tek elle kolay manevra kabiliyeti
- UPF 50+ Güneşlik
- Uzatılabilir Güneşlik
- Şeffaf havalandırma penceresi
- Yatar koltuk ünitesi
- Ters çevrilebilir koltuk ünitesi (çift yönlü kullanım)
- 4 tekerlekte de süspansiyon
- Entegre portbebe (Oturma kısmı port bebeye çevrilebilir)
- Patlamaya dayanıklı tekerlekler
- 3'ü 1 arada seyahat sistemine dönüştürme (maxi cosi ana kucağı ile 
- Ana kucağı ayrı satılmaktadır)

